/** @jsx jsx */
import React from 'react';
import { css, jsx } from '@emotion/core';

function Home() {
  const styles = css`
    background-image: ../../league_of_legends_wallpaper.jpg
  `;

  return (
    <div css={styles}>
      <input type="text"></input>
      <button>Search</button>
    </div>
  );
}

export default Home;
